/*----Vistas----*/
import Home from "./home.js";
import AboutUs from "./aboutUs.js";
import Mission from "./mission.js";
import Location from "./location.js";
import Appointments from "./appointments.js";

/*----Media----*/
import img from "../public/images/veterinariaestradamdpLogo.jpg";

/*----React-router-dom----*/
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

import {Navbar, Nav, NavDropdown} from 'react-bootstrap/Navbar'

function Header() {
  function myFunction() {
    var x = document.getElementById("myLinks");
    if (x.style.display === "block") {
      x.style.display = "none";
    } else {
      x.style.display = "block";
    }
  }

  return (
    <div className="body">
      <Router>
      <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
  <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
  <Navbar.Toggle aria-controls="responsive-navbar-nav" />
  <Navbar.Collapse id="responsive-navbar-nav">
    <Nav className="mr-auto">
      <Nav.Link href="#features">Features</Nav.Link>
      <Nav.Link href="#pricing">Pricing</Nav.Link>
      <NavDropdown title="Dropdown" id="collasible-nav-dropdown">
        <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
        <NavDropdown.Divider />
        <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
      </NavDropdown>
    </Nav>
    <Nav>
      <Nav.Link href="#deets">More deets</Nav.Link>
      <Nav.Link eventKey={2} href="#memes">
        Dank memes
      </Nav.Link>
    </Nav>
  </Navbar.Collapse>
</Navbar>
        <Switch>
          <Route exact path="/veterinariaestradamdp/">
            <Home />
          </Route>
          <Route path="/veterinariaestradamdp/aboutUs">
            <AboutUs />
          </Route>
          <Route path="/veterinariaestradamdp/mission">
            <Mission />
          </Route>
          <Route path="/veterinariaestradamdp/location">
            <Location />
          </Route>
          <Route path="/veterinariaestradamdp/appointments">
            <Appointments />
          </Route>
        </Switch>
      </Router>

      <link
        rel="stylesheet"
        href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css"
      />
    </div>
  );
}
export default Header;
